import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TableSortLabel from '@material-ui/core/TableSortLabel';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';

import CountryTableCell from './CountryTableCell';

const headCells = [
    { id: 'flag', numeric: false, isSortable: false, label: 'Dessert (100g serving)' },
    { id: 'name', numeric: false, isSortable: false,label: 'Calories' },
    { id: 'population', numeric: true, isSortable: false,label: 'Fat (g)' },
    { id: 'region', numeric: false, label: 'Carbs (g)' },
    { id: 'languages', numeric: false, label: 'Protein (g)' },
];

const useStyles = {

}

function CountryTableHead(props) {
    const classes = useStyles();

    return (
        <TableHead className={classes.header}>
            <TableRow>
                <CountryTableCell align="center">Flag</CountryTableCell>
                <CountryTableCell align="center">
                    Name
                                <TableSortLabel
                        active={true}
                    >
                    </TableSortLabel>
                </CountryTableCell>
                <CountryTableCell align="center">Population</CountryTableCell>
                <CountryTableCell align="center">Region</CountryTableCell>
                <CountryTableCell align="center">Languages</CountryTableCell>
                <CountryTableCell align="center"></CountryTableCell>
            </TableRow>
        </TableHead>
    )
}

export default CountryTableHead;
